import json
import logging
import traceback
import datetime
import os

def logConfig(path, botName):
    # if you are invoking directly or indirectly from a bot, give a path other than the default path of python which
    # is os.getcwd(). The reason is file creation will not be allowed in default path of bot run time which will also
    # be the python run time.

    if path != "":
        os.chdir(path)
    currDate = str(datetime.date.today())
    logger = logging.getLogger(__name__)
    logger.setLevel(logging.INFO)
    formatter = logging.Formatter('%(asctime)s:%(levelname)s:%(name)s:%(message)s')
    file_handler = logging.FileHandler(botName+'_'+currDate+".log")
    file_handler.setFormatter(formatter)
    logger.addHandler(file_handler)
    return logger

# Function to get the end_of_table_value
def endOfTable(filepath):
    with open(filepath, 'r', encoding='utf-8') as file:
        extraction_result = json.load(file)
    end_of_table = extraction_result["engineData"]["extractionResult"]["tableFeatures"][0]["endOfTableIndicator"]["text"]
    return end_of_table

def primaryColumn(filepath):
    with open(filepath, 'r', encoding='utf-8') as file:
        extraction_result = json.load(file)
    primary_col = extraction_result["engineData"]["extractionResult"]["tableFeatures"][0]["userDefinedPrimaryColumn"][0]["columnName"]
    return primary_col

# Function for end_of_table_check logic with dynamic columns (eot)
def end_of_table_check(current_entry, end_of_table_value, columns):
    for column in columns:
        if current_entry[column]["value"] == end_of_table_value:
            return True
    return False

def pc_null_check(current_entry, primary_column):
    return current_entry[primary_column]["value"] == ""

# Function for pc_null_check logic with dynamic columns
def empty_rows(current_entry, columns):
    # Return True if all specified columns are empty
    return all(current_entry[column]["value"] == "" for column in columns)

# Main function to process the JSON data
def row_delete(args):
    try:
        # Extracting parameters from args dictionary
        json_data = args["json_data"]
        file_path = args["file_path"]
        check_type = args["check_type"]
        columns = args["columns"]
        logPath = args['logPath']
        botName = args['botName']

        # Load the JSON data
        data = json.loads(json_data, strict=False)
        end_of_table_value = endOfTable(file_path)
        primary_column = primaryColumn(file_path)

        # Get the "table" array
        table_array = data["tables"]["table"]

        # Create a new list for updated table items
        updated_table = []
        i = 0
        while i < len(table_array):
            current_entry = table_array[i]

            # Handling different check types
            eot_condition_met = "eot" in check_type and end_of_table_check(current_entry, end_of_table_value, columns)
            empty_rows_condition_met = "empty_rows" in check_type and empty_rows(current_entry, columns)
            pc_null_check_condition_met = pc_null_check(current_entry, primary_column)
            if check_type == "eot OR empty_rows":
                if eot_condition_met or empty_rows_condition_met:
                    if eot_condition_met:
                        break
                    # Skip appending the row if pc_null_condition_met is True
                    if empty_rows_condition_met:
                        i += 1
                        continue

            elif check_type == "eot AND empty_rows":
                if eot_condition_met and empty_rows_condition_met:
                    break

            elif eot_condition_met:
                break

            # Append the current entry only if pc_null_condition_met is False
            if not empty_rows_condition_met:
                updated_table.append(current_entry)
            # Remove if primary column is null
            if pc_null_check_condition_met:
                i += 1
                continue


            i += 1

        # Update the "table" array with the filtered list
        data["tables"]["table"] = updated_table

        # Return the updated JSON data
        updated_json = json.dumps(data, indent=3)
        logger = logConfig(logPath, botName)
        return updated_json

    except Exception as innerException:
        logger.info("------------------------EXCEPTION FOUND--------------------")
        # Get the current line number where the exception occurred
        line_number = traceback.extract_tb(innerException.__traceback__)[-1].lineno
        # Get the error message
        error_message = str(innerException)
        # print(line_number, error_message)
        logger.error(f"line_number: {line_number}, error_message:{error_message}")
        return "Python Error Encountered in line number:"+ str(line_number)+' with error message:'+error_message



